pragma solidity ^0.4.15;

contract TicTacToe {
    uint8 constant boardSize = 3;
    uint constant gameCost = 0.1 ether;

    address[3][3] board;

    bool private moveActive = false;
    bool private gameEnded = false;
    uint8 private moveCount = 0;

    event GameOverWithWin(address _winner);
    event GameOverWithDraw(address _player1, address player2);
    event NextPlayer(address indexed _player);
    event PlayerJoined(address _player);
    event PayOutSuccess(address _player, uint _amountInWei);

    uint gameValidUntil;



    struct Player {
        address playerAddress;
        uint balanceToWithdraw;
    }
    Player player1;
    Player player2;

    address activePlayer;

    function TicTacToe() payable public {
        require(msg.value == gameCost);
        player1 = Player(msg.sender, 0);
        gameValidUntil = now + 3 minutes;
    }

    function getPlayer1() public view returns(address) {
      return player1.playerAddress;
    }
    function getPlayer2() public view returns(address) {
      return player2.playerAddress;
    }

    function joinGame() payable public {
        require(msg.value == gameCost);
        assert(player2.playerAddress == address(0));
        player2 = Player(msg.sender, 0);
        if(block.number % 2 == 0) {
            activePlayer = msg.sender;
        } else {
            activePlayer = player1.playerAddress;
        }

        NextPlayer(activePlayer);
        PlayerJoined(msg.sender);
    }

    function withdrawWin() public {
        if(msg.sender == player1.playerAddress) {
            player1.playerAddress.transfer(player1.balanceToWithdraw);
        } else if (msg.sender == player2.playerAddress) {
            player2.playerAddress.transfer(player2.balanceToWithdraw);
        } else {
            revert();
        }

    }

    function getBoard() public view returns (address[3][3]) {
        return board;
    }

    function setWinner(address _winner) private {
        gameEnded = true;

        uint balanceToSend = this.balance;

        if(_winner.send(balanceToSend) != true) {
            if(_winner == player1.playerAddress) {
                player1.balanceToWithdraw = this.balance;
            } else {
                player2.balanceToWithdraw = this.balance;
            }
        } else {
            PayOutSuccess(_winner, balanceToSend);
            GameOverWithWin(_winner);
        }
    }

    function emergencyBalanceAfterTimeout() public {
      assert(gameValidUntil < now);
      assert(gameEnded == false);

      setDraw();
    }

    function setDraw() private {
        gameEnded = true;
        uint balanceToSendEachPlayer = this.balance / 2 - 1;
        if(player1.playerAddress.send(balanceToSendEachPlayer) != true) {
          player1.balanceToWithdraw = balanceToSendEachPlayer;
        } else {
          PayOutSuccess(player1.playerAddress, balanceToSendEachPlayer);
        }

        if(player2.playerAddress.send(balanceToSendEachPlayer) != true) {
          player2.balanceToWithdraw = balanceToSendEachPlayer;
        } else {
          PayOutSuccess(player2.playerAddress, balanceToSendEachPlayer);
        }
        GameOverWithDraw(player1.playerAddress, player2.playerAddress);
    }

    function setStone(uint8 x, uint8 y) public {
        assert(x < 3 && y < 3);
        assert(board[x][y] == address(0));
        assert(gameEnded != true); //game still on?

        /**
         * Double Entry Attack Prevention
         * */
        assert(moveActive != true);
        moveActive = true;


        require(msg.sender == activePlayer);
        board[x][y] = activePlayer;
        moveCount++;


         //check end conditions

        //check column
        for(uint8 i = 0; i < boardSize; i++){
            if(board[x][i] != activePlayer) {
                break;
            }
            if(i == boardSize-1){
                setWinner(activePlayer);
                return;
            }
        }

        //check row
        for(i = 0; i < boardSize; i++){
            if(board[i][y] != activePlayer) {
                break;
            }
            if(i == boardSize-1){
                setWinner(activePlayer);
                return;
            }
        }

        //check diagonale
        if(x == y){
            for(i = 0; i < boardSize; i++){
                if(board[i][i] != activePlayer) {
                    break;
                }
                if(i == boardSize-1){
                    setWinner(activePlayer);
                    return;
                }
            }
        }

        //check counter diagonale
        if(x + y == boardSize - 1){
            for(i = 0; i < boardSize; i++){
                if(board[i][(boardSize-1)-i] != activePlayer) {
                    break;
                }
                if(i == boardSize-1){
                    setWinner(activePlayer);
                    return;
                }
            }
        }

        //check draw
        if(moveCount == (boardSize**2)){
            setDraw();
            return;
        }

        //determine the next player
        if(activePlayer == player1.playerAddress) {
            activePlayer = player2.playerAddress;
        } else {
            activePlayer = player1.playerAddress;
        }
        NextPlayer(activePlayer);
        //unlock
        moveActive = false;

        gameValidUntil = now + 3 minutes;
    }
}
